import React from 'react'
import './Banner.scss'
import modeling3d from '../../img/3d-modeling.png'
import automationcontrol from '../../img/automation-control.png'
import detailengineering from '../../img/detail-engineering.png'
import modulerskilleddesign from '../../img/moduler-skilled-design.png'
import scrubingsystem from '../../img/scrubing-system.png'
import softwaredevelopment from '../../img/software-development.png'
import solar_panel2 from '../../img/solar_panel2.png'

export default function Banner() {
    const data1 = [
        {
            img: automationcontrol,
            title: 'Industrial Automation'
        },
        {
            img: softwaredevelopment,
            title: 'MES & Software'
        },
        {
            img: modeling3d,
            title: 'Detail Engineering'
        },
    ]



    return (
        <div className="Banner">
            <div className="left"></div>
            <div className="mid">
                <div className="top">
                    {data1.map((box) => {
                        return <div className="box">
                            <img src={box.img} alt="" />
                            <span>{box.title}</span>
                        </div>
                    })}
                </div>
                <div className="bottom">
                    <span>mid</span>
                    <span>mid</span>
                    <span>mid</span>
                </div>
            </div>
            <div className="right"></div>
        </div>
    )
}
